package S;

import java.util.HashMap;

public class S76_fix {
    public static String minWindow(String s, String t) {
        int l = 0;
        String res = "";
        HashMap<Character, Integer> charInT = new HashMap<>(), window = new HashMap<>();
        for (int i = 0; i < t.length(); i++) {
            charInT.put(t.charAt(i), charInT.getOrDefault(t.charAt(i), 0) + 1);

        }

        int have = 0,need = charInT.size();
        for (int r = 0; r < s.length(); r++) {
            char c = s.charAt(r);
            window.put(c,window.getOrDefault(c,0)+1);
            if(charInT.containsKey(c)&&window.get(c)==charInT.get(c)){
                have++;
            }
            while(have == need){
                if(res.length()==0 || r-l+1<res.length()){
                    res = s.substring(l,r+1);
                }
                window.put(s.charAt(l), window.get(s.charAt(l)) - 1);
                if (charInT.containsKey(s.charAt(l))&&window.get(s.charAt(l))<charInT.get(s.charAt(l))){
                    have--;
                }
                l++;
            }
        }

    return res;
    }
    public static void main(String[] args) {
        //String s = "";
        //String t ="";

        //System.out.println(minWindow(s, t));
    }
}
